#############################################################################################################
###                                     Filament Sensor                                                     #
#############################################################################################################

[filament_switch_sensor toolhead_filament_sensor_t0]
Pause_on_runout: False
event_delay: 0.1
switch_pin: ^toolboard_t0:PB4
runout_gcode:
	_ON_TOOLHEAD_FILAMENT_SENSOR_RUNOUT TOOLHEAD=0
insert_gcode:
	_ON_TOOLHEAD_FILAMENT_SENSOR_INSERT TOOLHEAD=0
  
[gcode_button toolhead_filament_sensor_button_t0]
pin: ^!toolboard_t0:PB3
release_gcode:    
    {% if (printer.print_stats.state == "printing") %}
        _ON_TOOLHEAD_FILAMENT_SENSOR_CLOG TOOLHEAD=0
    {% else %}
        _ON_FILAMENT_SENSOR_BUTTON_PRESSED TOOLHEAD=0
    {% endif %}
press_gcode:

[filament_switch_sensor toolhead_filament_sensor_t1]
pause_on_runout: False
event_delay: 0.1
switch_pin: ^toolboard_t1:PB4
runout_gcode:
	_ON_TOOLHEAD_FILAMENT_SENSOR_RUNOUT TOOLHEAD=1
insert_gcode:
	_ON_TOOLHEAD_FILAMENT_SENSOR_INSERT TOOLHEAD=1
  
[gcode_button toolhead_filament_sensor_button_t1]
pin: ^!toolboard_t1:PB3
release_gcode:    
    {% if (printer.print_stats.state == "printing") %}
        _ON_TOOLHEAD_FILAMENT_SENSOR_CLOG TOOLHEAD=1
    {% else %}
        _ON_FILAMENT_SENSOR_BUTTON_PRESSED TOOLHEAD=1
    {% endif %}
press_gcode:

#############################################################################################################
###                                          IDEX Settings                                                  #
#############################################################################################################

[z_offset_probe]
pin: ^PG10                   # probe trigger pin
z_offset: -7                 # probe height, used to limit the probe z-move
y_offset: 0                  # probe y-offset, measured from the camera centre
x_offset: 37.5               # probe x-offset, measured from the camera centre
speed: 10                    # probe speed  
samples: 3                   # number of samples  
sample_retract_dist: 5
lift_speed: 10.0
samples_result: median
samples_tolerance: 0.2
samples_tolerance_retries: 5

[neopixel vaoc_led]
pin: PB0
chain_count: 6
color_order: GRB

[heater_fan vaoc_fan]
pin: PD13
heater: heater_bed
fan_speed: 1.0
heater_temp: 50

[gcode_macro RatOS]
variable_shaper_x_freq: [48.8, 46.2, 48.8, 47.9]       
variable_shaper_y_freq: [48.2, 46.2, 43.4, 43.1]           
variable_shaper_x_type: ["mzv", "mzv", "mzv", "mzv"]   
variable_shaper_y_type: ["mzv", "mzv", "mzv", "mzv"]
variable_bed_margin_y: [14.350, 34.650]

[dual_carriage]
position_max: 553.798
position_endstop: 553.798

[gcode_macro RatOS]
variable_bed_margin_x: [59.800, 53.798]

[gcode_macro _VAOC]
variable_expected_camera_x_position: 211.938
variable_expected_camera_y_position: 526.270

[gcode_macro T0]
variable_parking_position: -57.800

[gcode_macro T1]
variable_parking_position: 551.798

[ratos]
allow_unsupported_slicer_versions: True

[exclude_object]

